import React, { useEffect, useState } from "react";
import axios from "axios";
import "./Practice.css";
import { Table } from "reactstrap";
import "bootstrap/dist/css/bootstrap.css";
function Practice() {
  const [value, setValue] = useState([]);
  const [renderData, SetrenderData] = useState([]);
  useEffect(() => {
    axios.get(`https://jsonplaceholder.typicode.com/users`).then((res) => {
      const data = res.data;
      setValue(data);
    });
  }, [value]);

  const HandleDataFetch = () => {
    SetrenderData(value);
  };
  return (
    <div className="Wrapper">
      <button type="button" onClick={HandleDataFetch}>
        Click Me
      </button>
      <div>
        <Table>
          <thead>
            <tr>
              <th>User Id</th>
              <th>Name</th>
              <th>Email</th>
              <th>Address</th>
              <th>Contact</th>
            </tr>
          </thead>
          <tbody>
            {(() => {
              if (renderData) {
                renderData.map((value, index) => {
                  return (
                    <tr key={index}>
                      <td>{value.id}</td>
                      <td>{value.name}</td>
                      <td>{value.email}</td>
                      <td>{value.address.street}</td>
                      <td>{value.phone}</td>
                    </tr>
                  );
                });
              } else {
                return <td>Click the button</td>;
              }
            })()}
          </tbody>
        </Table>
      </div>
    </div>
  );
}

export default Practice;
